import React from "react";


function Header(){
    return (
        <header>
<nav>
    <div className="nav-wrapper">
      
      <ul id="nav-mobile" className="right">
        <li><Link to="/AboutMe">About Me</Link></li>
        
        <li><Link to="/Work">Work</Link></li>
        <li><Link to="/Contact">Contact</Link></li>
      </ul>
    </div>
  </nav>
        </header>
    )
}

export default Header;
